docs/servers/undertow.html.body:
Undertow

Using Undertow is our recommended way of running a Service

The SDK supports running a Service using the high-performance, embedded Undertow web server - this requires the 
sdk-server-undertow dependency.
Using Undertow is our recommended way of running a service, as it's very performant, easy to deploy, and it's the server 
we use the most internally so it's very battle tested in the realm of ManyWho Services!
Example
This is an example of integrating support for Undertow into a Service.
import com.manywho.sdk.services.servers.EmbeddedServer;
import com.manywho.sdk.services.servers.undertow.UndertowServer;

public class Application {
    public static void main(String[] args) throws Exception {
        EmbeddedServer server = new UndertowServer();
        server.addModule(new ApplicationModule());
        server.setApplication(Application.class);
        server.start();
    }
}

docs/servers/servlet3.html.body:
Servlet 3
Running using a Servlet 3 container (e.g. Tomcat) is supported with the SDK - you'll need to use the sdk-server-servlet3
dependency, which enables general support for a Service.
Currently, the SDK is only tested using Tomcat but the module is written to be compatible with multiple containers - if 
you encounter a problem using another container, feel free to open an issue 
and we'll try to get to the bottom of it.
Example
This is a simple example of integrating support for Servlet 3 into a Service.
pom.xml

    com.manywho.sdk
    sdk-server-servlet3
    ${version.sdk}


Application.java
import com.manywho.sdk.services.servers.Servlet3Server;

import javax.ws.rs.ApplicationPath;

@ApplicationPath("/")
public class Application extends Servlet3Server {
    public Application() {

        // Register any Guice modules that are needed
        this.addModule(new ApplicationModule());

        // Set the Application class (the entry point to the Service, usually this class)
        this.setApplication(Application.class);

        // Initialize the application
        this.start();
    }
}

docs/features/configuration.html.body:
Configuration
Configuration Settings are the way for a Flow builder to setup a Service with a specific configuration. For example, a generic Email Service might have SMTP Hostname and SMTP Port Configuration Settings that the builder can use to tell the Service to send emails through Gmail or Office 365.
The Java SDK gives you a way to easily define Configuration Settings in your service using annotations, and have these injected straight into your Actions, Databases, etc. The following documentation should have you creating Settings in no time!
Interface
The only interface used when defining Configuration Settings is Configuration, and is used for greatly simplified detection and generic hinting in the SDK.
Configuration
This interface contains no methods, but your Configuration Settings class must implement it to be picked up by the SDK. Only one class in your service may implement this interface.
Annotations
There is a single annotation in the Java SDK that is used to define a Configuration Setting:

@Configuration.Setting

@Configuration.Setting
The @Configuration.Setting annotation is used on fields in a class that should be used as definitions for Settings. Fields with this annotation are automatically included in the Service Description, meaning that Flow builders can setup the Service right away.
Annotation Elements

name (required) - this is used to define the name of the Configuration Setting, as seen by builders in ManyWho
contentType (required) - used by ManyWho to determine the kind of value this Setting can hold. Must be a value from the ContentType enum
required - used to determine whether a Configuration Setting is required when installing the Service

Example
The following example will define 2 Configuration Settings for a Service - a Username setting and a Password setting:
import com.manywho.sdk.api.ContentType;
import com.manywho.sdk.services.configuration.Configuration;

public class ServiceConfiguration implements Configuration {
    @Configuration.Setting(name = "Username", contentType = ContentType.String)
    private String username;

    @Configuration.Setting(name = "Password", contentType = ContentType.Password)
    private String password;

    public String getUsername() {
        return username;
    }

    public String getPassword() {
        return password;
    }
}

docs/features/database.html.body:
Database
A Database is a way for Services to handle Database actions in a managed way, using previously-defined Types.
The Java SDK provides a way to easily create Databases in your Service. The following documentation should give you a nice overview of how to define and use them.
Interfaces
There are 2 interfaces to choose from when defining a Database, depending on how your Types are defined.
Database
This interface should be used if your Service contains statically-defined Types (using the Type interface).
Generic Type Parameters

C - this parameter must be the previously-defined Configuration Settings class
T - this parameter must be the previously-defined Type

Methods
All methods have C configuration as their first parameter, which is an instance of the Service's Configuration Settings class, populated with the appropriate values from the request.

T create(C configuration, T object):
object - the object to be created/saved by the Service



This method will take the object passed in, assign an ID to it, save it in the appropriate store then return the object again (with the created ID).

List create(C configuration, List objects):
objects - a list of objects to be created/saved by the Service



This method will take a list of objects passed in, assign IDs to each item, save them in the appropriate store then return the list of objects again (with the created IDs).

void delete(C configuration, T object):
object - the object to be deleted by the Service



This method will take the passed in object and delete it from the appropriate store.

void delete(C configuration, List objects):
objects - the list of objects to be deleted by the Service



This method will take the passed in objects and delete them from the appropriate store.

T update(C configuration, T object):
object - the object to be updated/saved by the Service



This method will take the object passed in, update the existing record in the appropriate store, then return the updated object again.

List update(C configuration, List objects):
objects - the list of objects to be updated/saved by the Service



This method will take the list of objects passed in, update the existing records in the appropriate store, then return the updated list of objects again.
RawDatabase
This interface should be used if your Service contains dynamically-defined Types (probably through the TypeProvider interface).
Generic Type Parameters

C - this parameter must be the previously-defined Configuration Settings class

Methods
All methods have C configuration as their first parameter, which is an instance of the Service's Configuration Settings class, populated with the appropriate values from the request.

MObject create(C configuration, MObject object):
object - the object to be created/saved by the Service



This method will take the object passed in, assign an External ID to it, extract the Properties, save them in the appropriate store then return the object again (with the created External ID).

List create(C configuration, List objects):
objects - a list of objects to be created/saved by the Service



This method will take a list of objects passed in, assign External IDs to each item, extract the Properties, save them in the appropriate store then return the list of objects again (with the created External IDs).

void delete(C configuration, MObject object):
object - the object to be deleted by the Service



This method will take the passed in object and delete it from the appropriate store.

void delete(C configuration, List objects):
objects - the list of objects to be deleted by the Service



This method will take the passed in objects and delete them from the appropriate store.

MObject update(C configuration, MObject object):
object - the object to be updated/saved by the Service



This method will take the object passed in, update the existing record in the appropriate store, then return the updated object again.

List update(C configuration, List objects):
objects - the list of objects to be updated/saved by the Service



This method will take the list of objects passed in, update the existing records in the appropriate store, then return the updated list of objects again.
Example
This example shows a Database implementation to handle a Type called Person:
import com.manywho.sdk.api.run.elements.type.ListFilter;
import com.manywho.sdk.services.database.Database;
import com.manywho.services.example.ServiceConfiguration;
import com.manywho.services.example.repositories.PersonRepository;
import com.manywho.services.example.types.Person;

import javax.inject.Inject;
import java.util.List;
import java.util.stream.Collectors;

public class PersonDatabase implements Database {
    private final PersonRepository personRepository;

    @Inject
    public PersonDatabase(PersonRepository personRepository) {
        this.personRepository = personRepository;
    }

    @Override
    public Person create(ServiceConfiguration configuration, Person person) {
        return personRepository.create(configuration, person);
    }

    @Override
    public List create(ServiceConfiguration configuration, List objects) {
        return objects.stream()
                      .map(object -> create(configuration, object))
                      .collect(Collectors.toList());
    }

    @Override
    public void delete(ServiceConfiguration configuration, Person person) {
        personRepository.delete(configuration, person);
    }

    @Override
    public void delete(ServiceConfiguration configuration, List objects) {
        objects.forEach(object -> delete(configuration, object));
    }

    @Override
    public Person find(ServiceConfiguration configuration, String id) {
        return personRepository.find(id);
    }

    @Override
    public List findAll(ServiceConfiguration configuration, ListFilter filter) {
        return personRepository.findAll(filter.getLimit(), filter.getOffset());
    }

    @Override
    public Person update(ServiceConfiguration configuration, Person person) {
        return personRepository.update(configuration, person);
    }

    @Override
    public List update(ServiceConfiguration configuration, List people) {
        return people.stream()
                     .map(person -> update(configuration, person))
                     .collect(Collectors.toList());
    }
}

docs/features/files.html.body:
Files
Files can be loaded, saved and deleted using a Service, and the SDK provides a very easy way to support this with 
the FileHandler interface.
Interface
The only interface needed to provide support for Files is FileHandler, and this interface provides some methods that
greatly abstract some of the logic needed for file handling in Services.
FileHandler
This interface is used to create a handler to manage File actions.
Generic Type Parameters

C - this parameter must be the previously-defined Configuration Settings class

Methods

List findAll(C configuration, FileListFilter filter, String path) - this method has three parameters:
configuration - an instance of the Service's Configuration Settings class, populated with the appropriate values from the request
filter - the filter that should be used to search for Files
path - the path in which to search for files



The method should perform a search of the backing file store with any provided filters, and return a populated list of
$File objects.

$File upload(C configuration, String path, FileUpload upload) - this method has three parameters:
configuration - an instance of the Service's Configuration Settings class, populated with the appropriate values from the request
path - the path in which to upload the file
upload - an object containing the uploaded file as a stream, and the original filename if one was provided



The method should save the uploaded file into the backing file store, and return a single populated $File object.
Example
import com.manywho.sdk.api.run.elements.type.FileListFilter;
import com.manywho.sdk.services.files.FileHandler;
import com.manywho.sdk.services.files.FileUpload;
import com.manywho.sdk.services.types.system.$File;
import com.manywho.services.example.ServiceConfiguration;

import java.util.List;

public class FileHandlerExample implements FileHandler {
    private final FileManager fileManager;

    @Inject
    public FileHandlerExample(FileManager fileManager) {
        this.fileManager = fileManager;
    }

    @Override
    public List findAll(ServiceConfiguration configuration, FileListFilter filter, String path) {
        return fileManager.findAll(configuration, filter, path);
    }

    @Override
    public $File upload(ServiceConfiguration configuration, String path, FileUpload upload) {
        return fileManager.upload(configuration, path, upload.getContent(), upload.getName());
    }
}

docs/features/message-actions.html.body:
Message Actions
A Message Action is a method on a Service that allows a Flow to perform a task, like "Send an Email" or "Mark as Completed".
The Java SDK provides a way to easily create a Message Action in your service using annotations. Follow these instructions and you should have a working Message Action in no time!
Annotations
There are 3 annotations in the Java SDK that you use to create a Message Action:

@Action.Metadata
@Action.Input
@Action.Output

@Action.Metadata
The @Action.Metadata annotation is used on a class to indicate that the SDK should parse it as an Action. This means that when you add the Service to your Flow using the Draw Tool, this class will be added to the Service Description, allowing you to be able to use it in your Flow.
Annotation Elements

name (required) - this is used to define the name of the Action, as seen by builders in ManyWho
summary - this is used to provide a human-readable description of the Action to builders
uri - the URI that will be used to expose the action as a REST endpoint on the service (automatically prefixed with /actions in the SDK)

@Action.Input
The @Action.Input annotation is used to define the Inputs for an action, and fields annotated with it are automatically included in the Action metadata in the Service Description.
Annotation Elements

name (required) - this is used to define the name of the Input, as seen by builders in ManyWho
contentType (required) - used by ManyWho to determine the kind of value this Input can hold. Must be a value from the ContentType enum
required - used to determine whether an Input is required when using an Action in a Flow

@Action.Output
The @Action.Output annotation is used to define the Outputs for an action, and fields annotated with it are automatically included in the Action metadata in the Service Description.
Annotation Elements

name (required) - this is used to define the name of the Output, as seen by builders in ManyWho
contentType (required) - used by ManyWho to determine the kind of value this Output can hold. Must be a value from the ContentType enum
required - used to determine whether an Output is required when using an Action in a Flow

Interface
The interface to define the command for an action is ActionCommand. It has 4 generic type parameters, and defines an execute method to run your action and return an appropriate response.
ActionCommand
This interface is used to create a command to execute your previously-defined Action.
Generic Type Parameters

C - this parameter must be the previously-defined Configuration Settings class
A - this parameter must be the previously-defined class annotated with @Action.Metadata
I - this parameter must be the previously-defined class that has one or more fields annotated with @Action.Input
O - if any ouputs are required, this parameter must be the previously-defined class that has one or more fields annotated with @Action.Output, but if no outputs are required, this can be Void

Methods

ActionResponse execute(C configuration, ServiceRequest request, I input) - this method has three parameters:
configuration - an instance of the Service's Configuration Settings class, populated with the appropriate values from the request
request - the raw ManyWho request object
input - the class containing the populated @Action.Input fields



The method should then perform the required message logic, and return an ActionResponse object with the generic type of the desired output class, along with the appropriate InvokeType.
Example
The following example will create an Action called Send an Email, which will be automatically included in your Service Description:
SendAnEmail.java
This is the class that defines the Action, along with any Inputs and Outputs.
package com.manywho.services.example.actions;

import com.manywho.sdk.api.ContentType;
import com.manywho.sdk.services.actions.Action;

import java.time.OffsetDateTime;

@Action.Metadata(name = "Send an Email", summary = "Send an email that gives some information", uri = "sendanemail")
public class SendAnEmail {

    // This doesn't need to be a static inner class, but it helps to logically separate the inputs from the outputs
    public static class Input {
        @Action.Input(name = "To", contentType = ContentType.String)
        private String to;

        @Action.Input(name = "Subject", contentType = ContentType.String)
        private String subject;

        @Action.Input(name = "Message", contentType = ContentType.String)
        private String message;

        public String getTo() {
            return to;
        }

        public String getSubject() {
            return subject;
        }

        public String getMessage() {
            return message;
        }
    }

    public static class Output {
        @Action.Output(name = "Sent At", contentType = ContentType.DateTime)
        private OffsetDateTime sentAt;

        public Output(OffsetDateTime sentAt) {
            this.sentAt = sentAt;
        }
    }
}

SendAnEmailCommand.java
This is the class that actually runs the Action, given the incoming Inputs, and returns the appropriate Outputs back to ManyWho.
package com.manywho.services.example.actions;

import com.manywho.sdk.api.InvokeType;
import com.manywho.sdk.api.run.elements.config.ServiceRequest;
import com.manywho.sdk.services.actions.ActionCommand;
import com.manywho.sdk.services.actions.ActionResponse;
import com.manywho.services.example.ServiceConfiguration;
import com.manywho.services.example.actions.SendAnEmail.Input;
import com.manywho.services.example.actions.SendAnEmail.Output;
import com.manywho.services.example.managers.EmailManager;

import javax.inject.Inject;
import java.time.OffsetDateTime;

public class SendAnEmailCommand implements ActionCommand {
    private final EmailManager emailManager;

    @Inject
    public SendAnEmailCommand(EmailManager emailManager) {
        this.emailManager = emailManager;
    }

    @Override
    public ActionResponse execute(ServiceConfiguration configuration, ServiceRequest request, Input input) {
        // Do whatever logic is necessary to send the email here
        OffsetDateTime sentAt = emailManager.sendEmail(configuration, input.getTo(), input.getSubject(), input.getMessage());

        // Create the outputs
        Output output = new Output(sentAt);

        // Return the action response, telling the Flow to go forward
        return new ActionResponse<>(output, InvokeType.Forward);
    }
}

docs/features/types.html.body:
Types
A Type is an object used to send data to and from a Service that uses a predefined structure, e.g. an Account, Person or Message.
The Java SDK provides a way to easily create Types in your service using annotations. Follow these instructions and you should have some Types in no time!
Annotations
There are 3 annotations in the Java SDK that you use to create a Type:

@Type.Element
@Type.Identifier
@Type.Property

@Type.Element
The @Type.Element annotation is used on a class to indicate that the SDK should parse it as a Type Element. This means that when you add the Service to your Flow using the Draw Tool, this class will be added to the Service Description, allowing you to be able to use it in your Flow just like any other Type.
Annotation Elements

name (required) - this is used to define the name of the Type, as seen by builders in ManyWho
summary - this is used to provide a human-readable description of the Type to builders

@Type.Identifier
The @Type.Identifier annotation is to be used on fields in a class that already has the @Type.Element annotation. Each defined @Type.Element class must have a single String field that is annotated with @Type.Identifier, as it is used by ManyWho to uniquely identify each Value based on the Type.
Annotation Elements
None
@Type.Property
The @Type.Property annotation is used on fields in a class that already has the @Type.Element annotation. They are also automatically included in the Service Description, are able to be used as bound fields in a Flow, and can be used to store values inside your Service.
Annotation Elements

name (required) - this is used to define the name of the Property, as seen by builders in ManyWho
contentType (required) - used by ManyWho to determine the kind of value this property can hold. Must be a value from the ContentType enum
bound (default true) - determines whether any bindings will be automatically generated for this Property in the Service Description, so they can be used in Database Loads and Saves.

Interface
The only interface to define a Type is Type, and is used for greatly simplified Type detection and generic hinting in the SDK.
Type
This interface contains no methods, but each Type must implement it to be picked up by the SDK.
Example
The following example will create 2 properties on a Type called Person, each of a different ContentType, but the Age property won't be returned in a Database Load:
package com.manywho.services.example.types;

import com.manywho.sdk.api.ContentType;
import com.manywho.sdk.services.types.Type;

@Type.Element(name = "Person")
public class Person implements Type {

    @Type.Identifier
    private String id;

    @Type.Property(name = "Name", contentType = ContentType.String)
    private String name;

    @Type.Property(name = "Age", contentType = ContentType.Number, bound = false)
    private Integer age;

    public Person(String id, String name, Integer age) {
        this.id = id;
        this.name = name;
        this.age = age;
    }

    public Person() {
    }

    public String getId() {
        return id;
    }

    public String getName() {
        return name;
    }

    public Integer getAge() {
        return age;
    }
}
